    true,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selectedn          geographic and cartographic information
    from the U.S. Census Bureau's Master Address File / Topologically Integrated Geographic
    Encoding and Referencingn          (MAF/TIGER) Database (MTDB). The MTDB represents
    a seamless national file with no overlaps or gaps between parts, however, each TIGER/Line
    shapefile isn          designed to stand alone as an independent data set, or they
    can be combined to cover the entire nation. Urban Growth Areas (UGAs) are legally
    defined entitiesn          in Oregon and Washington that the Census Bureau includes
    in the MTDB in agreement with each State. UGAs, which are defined around incorporated
    places, aren          used to regulate urban growth. UGA boundaries, which need
    not follow visible features, are delineated cooperatively by State and local officials
    in Oregon andn          Washington. Each UGA is identified by a 5-digit numeric
    census code, usually associated with the incorporated place for which the UGA is
    named. UGAs weren          extended to the State of Washington for the 2010 Census.
    The UGAs for the 2010 Census were those in effect as of January 1, 2010.",nt"license_title":
